import React from 'react'
import Footer from '../components/Footer'
import Nav from '../components/Nav'
import { useEffect, useState } from 'react'
import {Link} from "react-router-dom"

function Vans() {
    const [vanData, setVanData]= useState([]);
    useEffect(()=>{
       fetch( "http://localhost:3000/vans")
       .then(res => res.json())
       .then(data => setVanData(data))
       console.log(vanData);
    },[])
    var classHolder;
    return (
        <div>
            <Nav/>
            <section className='van-container'>
            <h2 className='van-page-title'>Explore Our Van Options</h2>
                <div className='van-holder'>

              {
            vanData.map((van)=>{

              if (van.type==="simple"){
                    classHolder = "orange"
              }else if(van.type==="rugged"){
                  classHolder= "green"
              }else{
                  classHolder="black";
              }
               return <div className='van-card'>
                      <img src={van.imageUrl} alt="nothing-here"/>
                      <div className='van-id'>
                        <div className='van-but'>
                        <h2>{van.name}</h2>
                        <p>${van.price}<p>/day</p></p>
                        </div>
                        <br/>
                       <p className={classHolder} > <Link>{van.type}</Link></p>
                      </div>

                      </div>

            })
              }
              </div>
            </section>
            <Footer/>
        </div>
    )
}

export default Vans
